import React, { useState, useEffect } from 'react';
import tailwind from 'tailwind-rn';
import FormInput from "../../Form/FormInput";
import FormButton from "../../Form/FormButton";
import * as actions from "../../../Actions/medicalService";
import { connect } from "react-redux";
import { View, Text, StyleSheet } from 'react-native';
import Container from '@material-ui/core/Container';
import ParticlesBg from "particles-bg";
import '../home.css';
import { MDBContainer, MDBRow, MDBCol, MDBCard, MDBCardBody,  MDBBtn, MDBIcon, MDBModalFooter } from 'mdbreact';

let config = {
      num: [4, 7],
      rps: 0.1,
      radius: [5, 40],
      life: [1.5, 3],
      v: [2, 3],
      tha: [-50, 50],
      alpha: [0.6, 0],
      scale: [.1, 0.9],
      position: "all",
      color: [ "#ff0000"],
      cross: "dead",
      random: 10
    };




const Grossesse1 = (props) => {
  const [simple, setSimple] = useState(true)
  const [gpa, setGPA] = useState(true)
  const [sa, setSa] = useState(true)
  const [path, setPath] = useState(true)
  const [pathologie, setPathologie] = useState(null)


  var handleSimpleChange = (data) => {
      setSimple(data.target.value)
  }
  var handleGpaChange = (data) => {
      setGPA(data.target.value)
  }

  var handleSaChange = (data) => {
      setSa(data.target.value)
  }
  var handlePathChange = (data) => {
      setPath(data.target.value)
  }
  var handlePathologieChange = (text) => {
    setPathologie(text)
  }


  var handleSubmit = (e) => {
    var values = {
      antecedent: "grossesse",
      simple: simple,
      gpa: gpa,
      sa: sa,
      pathologie: pathologie
    }
    e.preventDefault();
    console.log(values)
    props.antecedentsMedicaux(props.patientList["cin"], values)
    props.navigation.navigate("AddAntecendentsMedicaux")
  }




  return (
    <section className="landing-background2">
    <div class=" d-flex align-items-center m-4 " style={{height: "550px"}}>
    <MDBContainer  style={{height: "350px"}}>
          <MDBRow>
            <MDBCol md="6">
              <MDBCard>
              <form>
              <h2 class="font-weight-bold text-center p-5 text-primary">Grossesse en cours</h2>
              <FormInput title="Ancienneté" placeholder="Ancienneté" onChangeText={handleSaChange} type="decimal-pad"  type="number"  />
              <FormInput title="Traitement" placeholder="Traitement" onChangeText={handleSaChange} />
              <div class="row mx-4">
      <label class="form-label mx-3">Equilibré?</label>
      <div class="form-check mx-1">
      <label class="form-check-label" for="Oui">
        <input type="radio" class="form-check-input" id="Oui" name="optradio" value={true} onChange={handleSaChange}/>Oui
      </label>
      </div>
      <div class="form-check mx-1">
      <label class="form-check-label" for="Non">
        <input type="radio" class="form-check-input" id="Non" name="optradio" value={false} onChange={handleSaChange}/>Non
      </label>
      </div>
      </div>
              <form class="row justify-content-center">
              <FormButton title="Retour" onPress={() => { props.navigation.navigate("AddAntecendentsMedicaux") }} />
              <FormButton title="Enregister" onPress={handleSubmit} />
              </form>
               </form>

              </MDBCard>
            </MDBCol>
          </MDBRow>
        </MDBContainer>
        </div>
        </section>
  );
};
const styles = StyleSheet.create({
  row: {
    flex: 1,
    flexDirection: "row",
    padding: 10
  },
  body: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#2193b0',
  },
});
const mapStateToProps = (state) => ({
  patientList: state.medicalService.patientList
});
const mapActionToProps = {

  antecedentsMedicaux: actions.antecedentsMedicaux
};

export default connect(mapStateToProps, mapActionToProps)(Grossesse1);
